import React from "react";

const Weather = (props) => {

		return(

			<div> 

			{ props.city && props.country && <p>The temperature in {props.city}, {props.country} is: {props.temperature}</p>}

			{props.humidty && <p>The humidity is: {props.humidity}</p> }

			{ props.description && props.wind && <p> You can expect: {props.description} and {props.wind} </p> }

			{props.error && <p> {props.error} </p>}

			</div>

		);

};

export default Weather;
